import React, { useState } from 'react';
import { 
  Box, 
  Grid, 
  Paper, 
  Typography, 
  LinearProgress,
  Chip,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions
} from '@mui/material';
import LocalOfferIcon from '@mui/icons-material/LocalOffer';

const Suggestions = ({ mockData }) => {
  const [selectedSuggestion, setSelectedSuggestion] = useState(null);

  const handleCloseSuggestion = () => {
    setSelectedSuggestion(null);
  };

  return (
    <Box>
      <Grid container spacing={3}>
        {mockData.suggestions.map((suggestion) => (
          <Grid item xs={12} md={4} key={suggestion.id}>
            <Paper sx={{ 
              p: 2,
              height: '100%',
              position: 'relative',
              overflow: 'hidden',
              '&::before': {
                content: '""',
                position: 'absolute',
                top: 0,
                left: 0,
                right: 0,
                height: '4px',
                background: suggestion.priority === 'high' 
                  ? 'linear-gradient(90deg, #d32f2f 0%, #ef5350 100%)'
                  : 'linear-gradient(90deg, #ed6c02 0%, #ff9800 100%)',
              }
            }}>
              <Box sx={{ display: 'flex', alignItems: 'flex-start', mb: 2 }}>
                <Box sx={{ flex: 1 }}>
                  <Typography variant="h6" sx={{ mb: 1, fontWeight: 600 }}>
                    {suggestion.title}
                  </Typography>
                  <Chip 
                    label={suggestion.department}
                    size="small"
                    sx={{ 
                      bgcolor: 'primary.light',
                      color: 'primary.contrastText',
                      fontWeight: 500
                    }}
                  />
                </Box>
                <Chip 
                  label={suggestion.status}
                  size="small"
                  color={suggestion.status === "Em andamento" ? "success" : "warning"}
                  sx={{ fontWeight: 500 }}
                />
              </Box>
              
              <Typography variant="body1" sx={{ mb: 2, color: 'text.secondary' }}>
                {suggestion.description}
              </Typography>
              
              <Box sx={{ mb: 2 }}>
                <Typography variant="body2" color="success.main" sx={{ fontWeight: 600, mb: 1 }}>
                  Impacto: {suggestion.impact}
                </Typography>
                <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                  <Box sx={{ flex: 1, mr: 1 }}>
                    <LinearProgress 
                      variant="determinate" 
                      value={suggestion.progress} 
                      color={suggestion.priority === 'high' ? 'error' : 'warning'}
                      sx={{ 
                        height: 8,
                        borderRadius: 4,
                        bgcolor: suggestion.priority === 'high' ? 'error.light' : 'warning.light',
                        '& .MuiLinearProgress-bar': {
                          borderRadius: 4,
                        }
                      }}
                    />
                  </Box>
                  <Typography variant="body2" color="text.secondary" sx={{ fontWeight: 600 }}>
                    {suggestion.progress}%
                  </Typography>
                </Box>
              </Box>

              <Box sx={{ 
                display: 'flex', 
                alignItems: 'center', 
                justifyContent: 'space-between',
                mt: 'auto'
              }}>
                <Typography variant="caption" color="text.secondary">
                  Prazo: {suggestion.deadline}
                </Typography>
                <Button 
                  variant="contained" 
                  size="small"
                  onClick={() => setSelectedSuggestion(suggestion)}
                  sx={{ 
                    textTransform: 'none',
                    bgcolor: suggestion.priority === 'high' ? 'error.main' : 'warning.main',
                    '&:hover': {
                      bgcolor: suggestion.priority === 'high' ? 'error.dark' : 'warning.dark',
                    }
                  }}
                >
                  Implementar
                </Button>
              </Box>
            </Paper>
          </Grid>
        ))}
      </Grid>

      {/* Suggestion Details Dialog */}
      <Dialog
        open={!!selectedSuggestion}
        onClose={handleCloseSuggestion}
        maxWidth="sm"
        fullWidth
      >
        {selectedSuggestion && (
          <>
            <DialogTitle>
              <Typography variant="h5" component="div" sx={{ display: 'flex', alignItems: 'center' }}>
                <LocalOfferIcon sx={{ mr: 1 }} />
                {selectedSuggestion.title}
              </Typography>
            </DialogTitle>
            <DialogContent>
              <Box sx={{ mt: 2 }}>
                <Typography variant="subtitle1" gutterBottom>
                  Descrição
                </Typography>
                <Typography variant="body1" paragraph>
                  {selectedSuggestion.description}
                </Typography>

                <Typography variant="subtitle1" gutterBottom>
                  Impacto
                </Typography>
                <Typography variant="body1" paragraph color="success.main">
                  {selectedSuggestion.impact}
                </Typography>

                <Box sx={{ mb: 2 }}>
                  <Typography variant="subtitle1" gutterBottom>
                    Progresso
                  </Typography>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                    <Box sx={{ flex: 1, mr: 1 }}>
                      <LinearProgress 
                        variant="determinate" 
                        value={selectedSuggestion.progress} 
                        color={selectedSuggestion.priority === 'high' ? 'error' : 'warning'}
                        sx={{ 
                          height: 8,
                          borderRadius: 4,
                          bgcolor: selectedSuggestion.priority === 'high' ? 'error.light' : 'warning.light',
                          '& .MuiLinearProgress-bar': {
                            borderRadius: 4,
                          }
                        }}
                      />
                    </Box>
                    <Typography variant="body2" color="text.secondary" sx={{ fontWeight: 600 }}>
                      {selectedSuggestion.progress}%
                    </Typography>
                  </Box>
                </Box>

                <Grid container spacing={2}>
                  <Grid item xs={6}>
                    <Typography variant="subtitle2" color="text.secondary">
                      Departamento
                    </Typography>
                    <Typography variant="body1">
                      {selectedSuggestion.department}
                    </Typography>
                  </Grid>
                  <Grid item xs={6}>
                    <Typography variant="subtitle2" color="text.secondary">
                      Prazo
                    </Typography>
                    <Typography variant="body1">
                      {selectedSuggestion.deadline}
                    </Typography>
                  </Grid>
                </Grid>
              </Box>
            </DialogContent>
            <DialogActions>
              <Button onClick={handleCloseSuggestion}>Cancelar</Button>
              <Button 
                variant="contained" 
                color={selectedSuggestion.priority === 'high' ? 'error' : 'warning'}
                onClick={() => {
                  console.log('Iniciando implementação:', selectedSuggestion.title);
                  handleCloseSuggestion();
                }}
              >
                Iniciar Implementação
              </Button>
            </DialogActions>
          </>
        )}
      </Dialog>
    </Box>
  );
};

export default Suggestions;
